import React, { useEffect } from 'react'
import { Link } from 'react-router-dom';

export default function Navbar({handleSignUpSuccess}) {
  const logout = async e => {
    e.preventDefault();
    try {
      localStorage.removeItem("token");
      handleSignUpSuccess(false);
      //toast.success("Logout successfully");
    } catch (err) {
      console.error(err.message);
    }
  };
  return (
    <div>
        <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
        <a className="navbar-brand" href="#">BULLS MARKET</a>
        <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
      
        <div className="collapse navbar-collapse" id="navbarSupportedContent">
          <ul className="navbar-nav mr-auto ml-3">
            <li className="nav-item active">
              <a className="nav-link" href="#">SELL <span className="sr-only">(current)</span></a>
            </li>
            <li className="nav-item active">
              <a className="nav-link" href="#">WISHLIST <span className="sr-only">(current)</span></a>
            </li>
            <li className="nav-item active">
              <Link onClick={e => logout(e)} to={"/login"} className="nav-link">LOGOUT<span className="sr-only">(current)</span></Link>
            </li>
          </ul>
          <form className="form-inline my-2 my-lg-0">
            <input className="form-control mr-sm-2" type="search" placeholder="Search" aria-label="Search"/>
            <button className="btn btn-outline-success my-2 my-sm-0" type="submit">Search</button>
          </form>
        </div>
      </nav>
    </div>
  );

};
